import ContentCard from './ContentCard.js';
import { StyledLoading } from './Loader-style.js';

const MainCard = ({className, isLoading, data, numberQuestions, userID, surveyID}) => {
    return ( 
        <div className={className}>
            {!isLoading && <h1>MicroSurvey</h1>}
            {!isLoading && <p>Details about the survey (optional)</p>}
            <span>
                {isLoading && <StyledLoading></StyledLoading>}
            </span>

            {!isLoading && <ContentCard data={data} numberQuestions={numberQuestions} userID={userID} surveyID={surveyID}></ContentCard>}
        </div>
     );
}

export default MainCard;
